import { Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import PageOne from "./pages/PageOne";
import PageTwo from "./pages/PageTwo";

function App() {
  return (
    <div>
      <Route path="/">
        <HomePage />
      </Route>
      <Route path="PageOne">
        <PageOne />
      </Route>
      <Route path="PageTwo">
        <PageTwo />
      </Route>
    </div>
  );
}

export default App;
